import React, {useEffect, useState} from "react";
import { Link } from "react-router-dom";
import { Container, Row, Col, Form, FormGroup, Input } from "reactstrap";
import Helmet from "../components/Helmet/Helmet";
import CommonSection from "../components/UI/CommonSection";

import "../styles/contact.css";

const socialLinks = [
  {
    url: "#",
    icon: "ri-facebook-line",
  },
  {
    url: "#",
    icon: "ri-instagram-line",
  },
  {
    url: "#",
    icon: "ri-linkedin-line",
  },
  {
    url: "#",
    icon: "ri-twitter-line",
  },
];

const Contact = () => {

  // const history = useHistory();
  const [userData, setUserData] = useState({});

  const callContact = async ()=>{
    try{
      const res = await fetch ('/getdata',{
        method:"GET",
        headers:{
          // Accept: "application/json",
          "Content-Type": "application/json"
        },
        // credentials:"include"
      });

      const data = await res.json();
      console.log(data);
      setUserData(data);

      if(!res.status === 200)
      {
        const error = new Error(res.error);
        throw error;
      }
    }
    catch(err)
    {
      console.log(err);
      // history.push('/login');
    }
  }

  useEffect(()=>{
    callContact();
  },[]);

  return (
    <Helmet title="Contact">
      <CommonSection title="Contact" />
      <section>
        <Container>
          <Row>
            <Col lg="7" md="7">
              <h6 className="fw-bold mb-4">Get In Touch</h6>
              <Form>
                <FormGroup className="contact__form">
                  <div className="contact_form_name d-flex justify-content-between align-items-between">
                    <input type="text" id="contact_form_name" className="contact_form_name input_field" value={userData.name}placeholder="Your name" required="true"/>
                  </div>
                  <div className="contact_form_email d-flex justify-content-between align-items-between">
                    <input type="email" id="contact_form_email" className="contact_form_email input_field"value={userData.email} placeholder="Your email" required="true"/>
                  </div>
                  <div className="contact_form_phone d-flex justify-content-between align-items-between">
                    <input type="phone" id="contact_form_phone" className="contact_form_phone input_field"value={userData.phone} placeholder="Your phone" required="true"/>
                  </div>
                  <Input placeholder="Your Name" type="text" />
                </FormGroup>
                <FormGroup className="contact__form">
                  <Input placeholder="Email" type="email" />
                </FormGroup>
                <FormGroup className="contact__form">
                  <textarea
                    rows="5"
                    placeholder="Message"
                    className="textarea"
                  ></textarea>
                </FormGroup>

                <button className=" contact__btn" type="submit">
                  Send Message
                </button>
              </Form>
            </Col>

            <Col lg="5" md="5">
              <div className="contact__info">
                <h6 className="fw-bold">Contact Information</h6>
                <p className="section__description mb-0">
                  1B-85,KIIT ,PATIA,BHUBANESWAR,ODISHA,INDIA
                </p>
                <div className=" d-flex align-items-center gap-2">
                  <h6 className="fs-6 mb-0">Phone:</h6>
                  <p className="section__description mb-0">+918317054041</p>
                </div>

                <div className=" d-flex align-items-center gap-2">
                  <h6 className="mb-0 fs-6">Email:</h6>
                  <p className="section__description mb-0">aryannigam65@gmail.com</p>
                </div>

                <h6 className="fw-bold mt-4">Follow Us</h6>

                <div className=" d-flex align-items-center gap-4 mt-3">
                  {socialLinks.map((item, index) => (
                    <Link
                      to={item.url}
                      key={index}
                      className="social__link-icon"
                    >
                      <i class={item.icon}></i>
                    </Link>
                  ))}
                </div>
              </div>
            </Col>
          </Row>
        </Container>
      </section>
    </Helmet>
  );
};

export default Contact;
